fun isSubsequence(s: String, t: String): Boolean {
    if (t.contains(s) || s.isEmpty()) return true
    if (t.isEmpty()) return false

    var keepSeeking: Boolean = true
    var newString: String = ""
    val tSize: Int = t.length
    var sPosAt: Int = 0
    var i: Int = 0

    while (keepSeeking) {
        if (t[i] == s[sPosAt]) {
            newString += t[i]
            sPosAt++
        }

        i++
        keepSeeking = i < tSize && newString.length < s.length
    }

    return newString == s
}

fun main() {
    val s: String = "leeeeetcode"
    val t: String =
            ""

    print(isSubsequence(s, t))
}
